import React from "react";
import { BrowserRouter as Router } from "react-router-dom";
import {
  MDBNavbar,
  MDBNavbarBrand,
  MDBNavbarNav,
  MDBNavItem,
  MDBNavLink,
  MDBNavbarToggler,
  MDBCollapse,
  MDBMask,
  MDBRow,
  MDBCol,
  MDBView,
  MDBContainer,
  MDBFormInline,
  MDBAnimation,
  MDBBtn, MDBCard, MDBCardBody, MDBCardImage, MDBCardTitle, MDBCardText,MDBBtnGroup,MDBIcon
} from "mdbreact";
import CardExample from './event1';
import FormPage from './form';
import Particles from 'react-particles-js';


const particleOpt = {
  "particles": {
    "number": {
        "value": 200,
        "density": {
            "enable": false
        }
    },
    "size": {
        "value": 8,
        "random": true
    },
    "move": {
        "direction": "bottom",
        "out_mode": "out"
    },
    "line_linked": {
        "enable": false
    }
},
"interactivity": {
    "events": {
        "onclick": {
            "enable": true,
            "mode": "remove"
        }
    },
    "modes": {
        "remove": {
            "particles_nb": 10
        }
    }
}
}

class Contact extends React.Component {
    render() {
        return(

            <div>
            
        
            <MDBContainer>
            <h2>Contact Us</h2>
            <br/><br/>
                <MDBRow>
                    <MDBCol md="6" lg="6" sm="12" ><FormPage/></MDBCol>
                    <MDBCol md="6" lg="6" sm="12">Lorem ipsum, dolor sit amet consectetur adipisicing elit. Necessitatibus placeat quae esse accusantium ducimus sit ex alias animi in nihil officiis aperiam sapiente exercitationem temporibus atque, numquam sint repellendus velit.
                    <br/><br/>
                    <div className="btn-toolbar" role="toolbar">
        <MDBBtnGroup className="mr-2">
          <MDBBtn color="indigo lighten-2">
          <MDBIcon fab icon="facebook-f" />
          </MDBBtn>
          <MDBBtn color="blue lighten-2">
          <MDBIcon fab icon="instagram" />
          </MDBBtn>
          <MDBBtn color="cyan lighten-2">
            <MDBIcon fab icon="twitter" />
          </MDBBtn>
        </MDBBtnGroup>
      </div></MDBCol>

                </MDBRow>
              
            </MDBContainer>
            <Particles
    params={particleOpt}
       />
            </div>
        );
    }
}

export default Contact;
